import React, { Component } from 'react'

export default class List extends Component {
    render() {

        return (
            <div className='row'>
                {

                    this.props.users.map((
                         (

                    <div className="card">
                            <a href='#' target="_blank" rel="noreferrer">
                            <img alt="profile" src='' style={{ width: '100px' }} />
                        </a>
                        <p className="card-text"></p>
                    </div>


                        )
                    ))

                }
                </div>

        )

    }
}
